import React from "react";
import {Modal} from "react-bootstrap";

const AddCategory=({ show, setShow, handleClose, handleShow })=>{
    return(
        <Modal
        size="lg"
        show={show}
        onHide={handleClose}
        backdrop="static"
        keyboard={false}
      >
        <Modal.Header closeButton>
          <Modal.Title>Add Category</Modal.Title>
        </Modal.Header>
        <Modal.Body>

        </Modal.Body>
        </Modal>
    )
} 

export default AddCategory;
